import React from 'react'

function Layout({ children }) {
    return (
        <div style={{ display: 'inline' }}>
            {children}
        </div>
    )
}

function TimoutScreen() {
    return (
        <div style={{ backgroundColor: 'gray', width: 100, height: 100, justifyContent: 'center', display: 'flex', alignItems: 'center' }}>
            test
        </div>
    )
}
function EffectArea() {
    return (
        <div style={{ backgroundColor: 'black', width: 600, height: 600 }}>
            test
        </div>
    )
}
export default function Timout() {

    return (
        <Layout >
            <TimoutScreen />
            <EffectArea />
        </Layout>
    )
}
